import React from "react";
import { Text, Input, Grid} from "../elements";

const Login = (props) => {
  return (
    <React.Fragment>
      <Grid padding ="16px">
        <Text size="32px" bold>로그인</Text>
          <Input
            label="아이디"
            placeholder="아이디를 입력해주세요."
            _onChange={() => {
              console.log("아이디 입력했어!");
            }}
          />
         <Input
            label="패스워드"
            placeholder="패스워드 입력해주세요."
            _onChange={() => {
              console.log("패스워드 입력했어!");
            }}
          />
        <button>로그인하기</button>
        </Grid>
    </React.Fragment>
  );
};

export default Login;
